import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter } from 'react-router-dom';
import App from './components/App';
import './index.css';

ReactDOM.render(
    <BrowserRouter>
        <React.StrictMode>
          <App />
      </React.StrictMode>
    </BrowserRouter>
    ,
  document.getElementById('root')
);
